control.onUpdate:
if (eb.isEmpty(g5.dataset1)) return;
name1 = g5.dataset1.getData(3, sender.rowIndex);
name2 = g5.dataset1.getData(4, sender.rowIndex);
if ((name1.length==0)&amp;&amp;(name2.length==0)) {
    ee.setText(sender, "");
    return;
}
if (name1.length==0) {
    name1 = "无";
}
if (name2.length==0) {
    name2 = "无";
}
text = "<font color = '#d03030'>中文：</font>" + name1 + "<br/>"; 
text += "<font color = '#d03030'>英文：</font>" + name2;
ee.setText(sender, text);

if (eb.isEmpty(g5.dataset1)) return;
name1 = g5.dataset1.getData(5, sender.rowIndex);
name2 = g5.dataset1.getData(6, sender.rowIndex);
if ((name1.length==0)&amp;&amp;(name2.length==0)) {
    ee.setText(sender, "");
    return;
}
if (name1.length==0) {
    name1 = "无";
}
if (name2.length==0) {
    name2 = "无";
}
text = "<font color = '#d03030'>中文：</font>" + name1 + "<br/>"; 
